(1, 'Agentes Colaborativos', 'Comparte y Aumenta tus Cierres', 'La gran mayoría de los Agentes Inmobiliarios están encantadas de colaborar con otros Agentes o Asesores y no tienen problemas en compartir su comisión, pero existe una minoría que no quieren saber del tema.\r\nLo más beneficioso para tú cliente y para ti es compartir comisiones para que el inmueble se venda más rápido y no tratar de venderlo tú sólo pensando que ganaras más dinero.\r\nCompartir comisiones crea un mercado inmobiliario más dinámico, da más trabajo y sobre todo beneficia a los clientes que ven como su propiedad se alquila o vende con mayor rapidez y posiblemente al mejor precio también.', 1, '/images/upload/1606695861.jpeg', '2020-07-30 00:00:00.000000', NULL, '2021-02-20'),
(2, 'Ofrece Opciones a tu cliente', 'Si no tienes otro similar apóyate con tus colegas', 'Un buen Agente Inmobiliario tiene múltiples ofertas de inmuebles para ofrecer a los clientes. Al ofrecer varias propiedades, puedes encontrar una opción que se adecue a las necesidades del cliente, a lo que busca, sin necesidad de tener que presionarlo para que compre con una única opción que le ofreces.\r\nSi un cliente te llama por una de las propiedades de tú cartera y no tienes otras con las mismas características ubica con tus colegas otras similares y coordina para que ese día puedas mostrarle un par de opciones más. Esto aumentara las posibilidades de venta y de convertirte en su Agente exclusivo.\r\nNo te ciegues y te aferres a la idea absoluta que tú inmueble será el indicado para tú prospecto. Es preferible hacer una venta compartida que perder el cliente ya que si tu propiedad no le gusta ira en busca otras que ver y lo más seguro llamara a otros asesores.', 1, '/images/upload/1596179671.jpeg', '2020-07-31 00:00:00.000000', NULL, '2021-02-13'),
(3, 'Compartes Comisiones?', '+ Compartes + Oportunidades= +Cierres', 'Según cifras del 2019 de las empresas y las franquicias inmobiliarias más grandes de Perú. En promedio el 70% de los cierres de operaciones inmobiliarias fueron de manera compartida. Esto confirma que la colaboración inmobiliaria es la mejor opción para incrementar tus cierres. \r\nEsta, muy bien decir como Agente Inmobiliario que compartes comisión, pero eso no es suficiente, debes colocarlo también explícitamente en el contrato de corretaje y explicarle a tu cliente los beneficios que esto le traerá. \r\nDe esta manera el propietario entenderá que no necesita un ejército de agentes pues a través de ti puede contar con que compartirás su propiedad con todos los demás profesionales inmobiliarios.', 1, '/images/upload/1606546879.png', '2020-09-25 00:00:00.000000', NULL, '2021-02-06');

